(14, 14, 6, 'Hello,\r\n\r\nHeartburn is actually a symptom of GERD (gastroesophageal reflux disease), and is caused by acid refluxing back into the esophagus. Risk factors include those that increase the production of acid in the stomach, as well as structural problems that allow acid reflux into the esophagus.\r\n\r\nTry the followings:\r\n1.Wear loose clothing.\r\n2.Practice proper posture.\r\n3.Elevate from the waist up.\r\n4.Mix in a teaspoon of baking soda into a glass of water.\r\n5.Chew gum to help neutralize acid.\r\n6.Stay away from cigarette smoke.\r\n7.Try over-the-counter medications.', '2017 Jun 14'),
(15, 16, 6, 'asdasdasdasdasd', '2017 Jun 14');
